import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import { Provider } from "react-redux";
import store from "../../store/store";
import Homepage from '../HomePage'
import ContactPage from '../ContactPage'
import AboutPage from '../AboutPage'
import RegisterPage from '../RegisterPage';
import ResetPasswordPage from '../ResetPasswordPage';
import LoginPage from '../LogInPage';
import SpecialProduts from '../ProductsSpecialPage'
import SearchPage from '../SearchPage';
import CartPage from '../CartPage';
import ByCategoryPage from '../ByCategoryPage';
import DetailProductPage from '../DetailsProductPage';
import BlogPage from '../BlogPage';
import ProductTops from '../ProductTops'
import CheckoutPage from '../CheckoutPage'
import ProfilePage from '../ProfilePage';
import PrivateRoute from '../PrivateRoute';
import WishlistPage from '../WishlistPage';
import ProductByName from '../DetailsProductPage/product_by_name';
const AllRoute = () => {

  return (
    <React.StrictMode>
       <Provider store={store}>
      <div className="App">
        <Router>
          <Switch>
            <Route exact path='/' component={Homepage} />
            <Route path='/home' component={Homepage} />
            <Route path='/contact-us' component={ContactPage} />
            <Route path='/about-us' component={AboutPage} />
            <Route path='/register' component={RegisterPage} />
            <Route path='/login' component={LoginPage} />
            <Route path='/reset-password/:resetToken' component={ResetPasswordPage} />
            <Route path='/special-offers' component={SpecialProduts} />
            <Route path='/search' component={SearchPage} />
            <Route path='/cart' component={CartPage} />
            <Route path='/by-category' component={ByCategoryPage} />
            <Route path='/products/ref/:reference' component={DetailProductPage} />
            <Route path='/products/:name' component={ProductByName} />
            {/* <Route path='/product' component={DetailProductPage} /> */}
            <Route path='/blog' component={BlogPage} />
            <Route path='/products' component={ProductTops} />
            <PrivateRoute path='/checkout' component={CheckoutPage} />
            <PrivateRoute path='/profile' component={ProfilePage} />
            <PrivateRoute path='/wishlist' component={WishlistPage} />
            <Route path='/*' component={Homepage} />
          </Switch>
        </Router>
      </div>
      </Provider>
    </React.StrictMode>
  );
}

export default AllRoute;
